import snowflake from "./assets/snowflake.svg";
import stamp from "./assets/stamp.svg";
import stockings from "./assets/stockings.svg";
import "./App.css";

const names = [
  "Fara Richter",
  "Stefan Richter",
  "Victoria Richter",
  "Issam Richter",
  "Saranne Richter",
  "Matthew Morales",
  "Pauline Frank",
  "Banjamin Richter",
];

function App() {
  return (
    <div className="App">
      <img src={stockings} className="Stockings" alt="stockings" />
      <img src={stamp} className="Stamp" alt="stamp" />
      <header className="Title">
        <h2>Letters</h2>
        <h1>Santa</h1>
      </header>
      <body className="Body">
        <text>Select Donor Name</text>
        <select className="Doner">
          {names.map((name, i) => (
            <option value={i}>{name}</option>
          ))}
        </select>
        <text>Donee Name</text>
        <p className="Donee">YOLO</p>
      </body>
      <footer className="Footer">
        <h3>NORTH POLE</h3>
        <img
          src={snowflake}
          className="Snowflake"
          alt="snowflake-right"
          style={{ right: "34px" }}
        />
        <img
          src={snowflake}
          className="Snowflake"
          alt="snowflake-left"
          style={{ left: "34px" }}
        />
      </footer>
    </div>
  );
}

export default App;
